local isHidden = false

-- Table to store injected scripts
local injectedScripts = {}

-- Function to toggle between showing and hiding the executor
toggleButton.MouseButton1Click:Connect(function()
    if not isHidden then
        -- Hide the executor
        frame.Visible = false
        cubeButton.Visible = true
    else
        -- Show the executor
        frame.Visible = true
        cubeButton.Visible = false
    end

    isHidden = not isHidden
end)

-- Function to bring back the executor when the cube is pressed
cubeButton.MouseButton1Click:Connect(function()
    frame.Visible = true
    cubeButton.Visible = false
    isHidden = false
end)

-- Function to handle Inject button click
injectButton.MouseButton1Click:Connect(function()
    local scriptCode = scriptBox.Text
    if scriptCode and scriptCode ~= "" then
        -- Store the injected script
        table.insert(injectedScripts, scriptCode)
        -- Clear the script box after injection
        scriptBox.Text = ""
        print("Script injected and stored.")
    else
        print("No script to inject.")
    end
end)

-- Function to handle Execute button click
executeButton.MouseButton1Click:Connect(function()
    -- Iterate over all stored scripts and execute them
    for _, scriptCode in ipairs(injectedScripts) do
        local success, errorMsg = pcall(function()
            loadstring(scriptCode)()
        end)
        if not success then
            warn("Error executing script: " .. errorMsg)
        end
    end
end)

-- Function to handle Clear button click
clearButton.MouseButton1Click:Connect(function()
    scriptBox.Text = ""
end)

